import React from "react"
import { Col, Container, Row } from "react-bootstrap";

const Shop = (props) => {
  return (
    <Container>
      <Row>
        <Col md={3}>
        </Col>
        <Col md={9}>
        </Col>
      </Row>
    </Container>
  )
};

export default Shop;
